Looks like Android Studio is very unhappy about _Nonnull used now in NDK r15. You can choose the GCC compiler

android { defaultConfig { externalNativeBuild { ndkBuild { 
   arguments "NDK_TOOLCHAIN_VERSION=4.9" 
}}}}

or you can disable the new Unified Headers:

android { defaultConfig { externalNativeBuild { ndkBuild { 
   arguments "APP_DEPRECATED_HEADERS=true" 
}}}}

Or you can switch to NDK r14 or earlier.

I have opened an issue for Android Studio/C++ dev.

